import React from "react";
import Link from 'next/link';
import { Container, Row, Col } from "react-grid-system";
import { Tab, Tabs, TabList, TabPanel } from "react-tabs";

// Components
import Headline from "../../components/common/Headline";
import portfolio from "../../components/common/tables/parteneri_table";


function Parteneri() {
    return (
        <section className="section section-portfolio section-portfolio-1 bg-gradient-side overlay-color">
            <span className={`bg-color bg-dark-60 ${portfolio.class}`}></span>
            <div className="display-spacing">
                <Container className="container">
                    <Headline label="Portfolio" title="Let's See Our portfolio" divider_1={true} position="center" />
                    <Tabs className={`el-tabs el-tabs-1 ${portfolio.class}`}selectedTabClassName="active">
                        <TabList className={`el-tabs-links ${portfolio.class}`}>
                            {portfolio.map((category, categoryIndex) => (
                                <Tab key={categoryIndex}>{category.name}</Tab>
                            ))}
                        </TabList>
                        {portfolio.map((category, categoryIndex) => (
                            <TabPanel key={categoryIndex}>
                                <Row className="row-center mb--30">
                                    {category.items.map((item, index) => (
                                        <Col key={index} xs={6} sm={6} md={6} lg={3} xl={3}>
                                            <div className={`portfolio-item ${category.class}`}>
                                                <Link href={`/home-1${item.link}`}>
                                                    <div className="portfolio-card">
                                                        <div className="image overlay-image" style={{ backgroundImage: `url(${item.image})` }} />
                                                        <div className="content">
                                                            <span>{item.title}</span>
                                                            <h3>{item.subtitle}</h3>
                                                        </div>
                                                    </div>
                                                </Link>
                                            </div>
                                        </Col>
                                    ))}
                                </Row>
                            </TabPanel>
                        ))}
                    </Tabs>
                </Container>
            </div>
        </section>
    );
}

export default Parteneri;
